Naughty Bookworms ~ Brittney Banxxx 

May 3, 2011 

Prof Stone comes into Prof Christian\'s classroom to discuss something related to a project they are working on. Prof Christian seems distracted and nervous. Prof Stone doesn\'t catch on for a minute, but then he knows whats going on. Christian is stealing his move! The cute young co-ed is blowing Christian under his desk for her A! Prof. Stone reprimands Christian for stealing his move as Christian leaves the room. The co-ed also tries to leave, but Prof. Stone stops her.....she isn\'t done working for that A yet.
